export const LessonComponent = ({ lesson }) => {
  return (
    <div>
      <h2>{lesson.title}</h2>
      <p>{lesson.introduction}</p>
      <ul>
        {lesson.mainPoints.map((point, index) => (
          <li key={index}>{point}</li>
        ))}
      </ul>
    </div>
  );
};
